function Payment() {
  return (
    <form>
      <h1>Payment</h1>
      <input placeholder=" Card Number"></input>
      <input placeholder="expiry date"></input>
      <input placeholder="cvv"></input>
      <input placeholder="Name on Card"></input>
    </form>
  );
}
export default Payment;
